import "./Banner.css";
import veniceLogoPink from "../../img/veniceLogoPink.png";

function Banner() {
  return (
    <>
      <div className='banner'>
        <div className='container'>
          <img class='container-img' src={veniceLogoPink} />
        </div>
        <a class='btn btn-gradient' href='#'>
          Start Now
        </a>
      </div>
    </>
  );
}

export default Banner;
